var wrapper = document.querySelector('.filter-wrapper.photo');
var wrapperGallery = document.querySelector('#lightgallery');
init();

function init() {
  if (!wrapper && !wrapperGallery) return;
  fetch('http://localhost:1337/photos').then(function (response) {
    return response.json();
  }).then(function (data) {
    console.log(data);
    createGallery(data);
    addActive(data);
    initGallery();
  });
}

function createGallery(list) {
  list.forEach(function (item) {
    wrapperGallery.insertAdjacentHTML('afterbegin', "\n    <div class=\"col-12 col-sm-6 col-md-4 col-xl-3 mt-30 gallery-item-grid\" data-filter=\"".concat(item.filter, "\">\n      <a href=\"http://localhost:1337").concat(item.image.url, "\" class=\"gallery-item\">\n        <img src=\"http://localhost:1337").concat(item.image.url, "\" alt=\"\" />\n      </a>\n    </div>\n    "));
  });
}

function initGallery() {
  lightGallery(wrapperGallery, {
    mode: 'lg-fade',
    cssEasing: 'cubic-bezier(0.25, 0, 0.25, 1)',
    selector: 'a',
    download: false
  });
}

function addActive(initialList) {
  var filters = wrapper.querySelectorAll('.filter-item');
  filters.forEach(function (filter) {
    filter.addEventListener('click', function (evt) {
      removeAllActive();
      filter.classList.add('active');
      var data = evt.target.getAttribute('data-filter');
      filterList(data, initialList);
    });
  });
}

function removeAllActive() {
  var filters = wrapper.querySelectorAll('.filter-item');
  filters.forEach(function (filter) {
    filter.classList.remove('active');
  });
}

function filterList(data, initialList) {
  wrapperGallery.innerHTML = "";

  if (data == 'all') {
    createGallery(initialList);
  } else {
    var newList = initialList.filter(function (el) {
      return el.filter == data;
    });
    createGallery(newList);
  }

  window.lgData[wrapperGallery.getAttribute('lg-uid')].destroy(true);
  initGallery();
}

