function init() {
  if (!wrapper && !wrapperGallery) return;
  createGallery(listPhoto);
  addActive();
}

function createGallery(list) {
  list.forEach(function (item, index) {
    if (item.inProduction) {
      wrapperGallery.insertAdjacentHTML('afterbegin', "\n    <div class=\"col-12 col-md-4 mt-30\" data-filter=\"type-".concat(item.type, "\">\n      <div class=\"simple-video\">\n        <div class=\"preview\">\n          <img src=\"").concat(item.cover, "\" alt=\"\">\n          <span class=\"icon material-icons-outlined\">movie</span>\n        </div>\n        <h2 class=\"title\">").concat(item.title, "</h2>\n      </div>\n    </div>\n    "));
    } else {
      wrapperGallery.insertAdjacentHTML('afterbegin', "\n      <div class=\"col-12 col-md-4 mt-30\" data-filter=\"type-".concat(item.type, "\">\n        <div class=\"simple-video\">\n          <a data-toggle=\"modal\" data-target=\"#modal-video\" data-id=\"").concat(item.id, "\" class=\"preview\">\n            <img src=\"").concat(item.cover, "\" alt=\"\">\n            <span class=\"icon material-icons-outlined\">play_circle_outline</span>\n          </a>\n          <h2 class=\"title\">").concat(item.title, "</h2>\n        </div>\n      </div>\n      "));
    }
  });
}

function addActive() {
  var filters = wrapper.querySelectorAll('.filter-item');
  filters.forEach(function (filter) {
    filter.addEventListener('click', function (evt) {
      removeAllActive();
      filter.classList.add('active');
      var data = evt.target.getAttribute('data-filter');
      filterList(data);
    });
  });
}

function removeAllActive() {
  var filters = wrapper.querySelectorAll('.filter-item');
  filters.forEach(function (filter) {
    filter.classList.remove('active');
  });
}

function filterList(data) {
  wrapperGallery.innerHTML = "";

  if (data == 'all') {
    createGallery(listPhoto);
  } else {
    var newList = listPhoto.filter(function (el) {
      return 'type-' + el.type == data;
    });
    createGallery(newList);
  }
}

